In order for PHP to connect to MariaDB, it needs to authenticate itself. To do that, we will create a login.php file in /var/www/html . We also need to change the group ownership of the file and its permissions so that the file can be read by the Apache2 web server but not by the world, since this file will store password information. cd /var/www/html/
sudo touch login.php
sudo chmod 640 login.php
sudo chown :www-data login.php
ls -l login.php
nano login.php In the file, add the following credentials. If you used a different database name than linuxdb and a different username than webapp , then you need to substitute your names below. You need to use your own password where I have the Xs: <?php // login.php
$db_hostname = "localhost";
$db_database = "linuxdb";
$db_username = "webapp";
$db_password = "XXXXXXXXX";
?> Next we create a new PHP file for our website. This file will display HTML but will primarily be PHP interacting with our MariaDB distributions database. Create a file titled distros.php . sudo nano distros.php Then copy over the following text (I suggest you transcribe it, especially if you're interested in learning a bit of PHP, but you can simply copy and paste it into the nano buffer): <html>
<head>
<title>MySQL Server Example</title>
</head>
<body> <?php // Load MySQL credentials
require_once 'login.php'; // Establish connection
$conn = mysqli_connect($db_hostname, $db_username, $db_password) or die("Unable to connect"); // Open database
mysqli_select_db($conn, $db_database) or die("Could not open database '$db_database'"); // QUERY 1
$query1 = "show tables from $db_database";
$result1 = mysqli_query($conn, $query1); $tblcnt = 0;
while($tbl = mysqli_fetch_array($result1)) { $tblcnt++;
} if (!$tblcnt) { echo "<p>There are no tables</p>\n";
}
else { echo "<p>There are $tblcnt tables</p>\n";
} // Free result1 set
mysqli_free_result($result1); // QUERY 2
$query2 = "select name, developer from distributions";
$result2 = mysqli_query($conn, $query2); $row = mysqli_fetch_array($result2, MYSQLI_NUM);
printf ("%s (%s)\n", $row[0], $row[1]);
echo "<br/>"; $row = mysqli_fetch_array($result2, MYSQLI_ASSOC);
printf ("%s (%s)\n", $row["name"], $row["developer"]); // Free result2 set
mysqli_free_result($result2); // Query 3
$query3 = "select * from distributions";
$result3 = mysqli_query($conn, $query3); while($row = $result3->fetch_assoc()) { echo "<p>Owner " . $row["developer"] . " manages distribution " . $row["name"] . ".</p>";
} mysqli_free_result($result3); $result4 = mysqli_query($conn, $query3);
while($row = $result4->fetch_assoc()) { echo "<p>Distribution " . $row["name"] . " was released on " . $row["founded"] . ".</p>";
} // Free result4 set
mysqli_free_result($result4); /* Close connection */
mysqli_close($conn); ?> </body>
</html> Save the file and exit out of nano.
